import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import RegistrationForm from './Signup'; // Importing RegistrationForm component
import Login from './Login'; // Importing Login component
import logo from './logo.svg'; // Importing logo image

function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<RegistrationForm />} /> {/* Use RegistrationForm for root path */}
          <Route path="/home" element={<RegistrationForm />} /> {/* Use RegistrationForm for /home path */}
          <Route path="/login" element={<Login />} /> {/* Use Login for /login path */}
        </Routes>
      </BrowserRouter>
      <img src={logo} alt="Logo" />
    </div>
  );
}

export default App;
